import React from 'react';
import { Form, Input } from '@rocketseat/unform';
import { Link } from 'react-router-dom';
import * as Yup from 'yup';
import { Logo, Container1, Container2, Wrapper } from './styles';

import logo from '../../assets/400dpiLogoCropped.png';

// import { Container } from './styles';

export default function SignIn() {
  const schema = Yup.object().shape({
    email: Yup.string()
      .email('Insira um e-mail válido')
      .required('Campo obrigatório'),
    password: Yup.string().required('Campo obrigatório'),
  });

  return (
    <Wrapper>
      <Container2>
        <div>
          <h1>AINDA NÃO ABRIU</h1>
          <h1>SUA CONTA?</h1>
        </div>
        <div>
          <p>Depósidos, transferências e retiradas com</p>
          <p>segurança e eficiência</p>
        </div>
      </Container2>

      <Container1>
        <Logo src={logo} alt="logo" />
        <Form schema={schema}>
          <Input name="usuario" type="email" placeholder="Email" />
          <Input name="senha" type="password" placeholder="Senha" />

          <div>
            <p>
              Esqueceu sua senha? <Link to="/signup">clique aqui</Link>
            </p>
            <button type="submit">LOGIN</button>
          </div>
        </Form>
      </Container1>
    </Wrapper>
  );
}
